const emojiKeys = Object.keys(assets.emoji);

function getRandomEmoji(): string {
  const randomIndex = Math.floor(Math.random() * emojiKeys.length);
  const randomKey = emojiKeys[randomIndex];
  return assets.getEmoji(randomKey);
}